import axios from "axios";

const baseURL = "http://localhost:3030"

export async function pageLoadEvent() {
    const res = await axios.post(`${baseURL}/events`, {
        type: "Page load",
        timestamp: Date.now()
    })
    return res;
}

export async function adClickedEvent(e) {
    e.preventDefault();
    const res = await axios.post(`${baseURL}/events`, {
        type: "Ad clicked",
        timestamp: Date.now(),
        slot: e.target.id,
        googleQueryId: e.target.getAttribute("data-google-query-id")
    })
    return res;
}

export async function adViewedEvent() {
    window.googletag.cmd.push(function() {
        window.googletag.pubads().addEventListener('impressionViewable', async function(e) {
            // Send event;
            let data = {
                type: "Ad slot viewed",
                slot_id: e.slot.getSlotElementId(),
                timestamp: Date.now()
            }
            const res = await axios.post(`${baseURL}/events`, data)
            console.log("Ad viewed, res:", res);
            return res;
        });
    });
}
